import React from 'react';
import styled from 'styled-components';

const Value = (props) => {

    const Wrapper = styled.div`
        display: flex;
        flex-direction: row;
        justify-content: center;
    `;

    return(
    <>
        <h1>{props.valueTitle}</h1>
        <p>{props.valueText}</p>
    </>
    );
}

export default Value;
